pragma solidity ^0.8.0;


import "node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "node_modules/@openzeppelin/contracts/security/Pausable.sol";
import "node_modules/@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "node_modules/@openzeppelin/contracts/utils/Context.sol";
import "node_modules/@openzeppelin/contracts/access/Ownable.sol";

contract TwetherPost is ERC721Enumerable, ERC721Burnable, Pausable, Ownable{

    struct Post {
        bytes text;
        bytes media_url;
        uint8 postType;
        uint160 author;
        uint parentPost;
        uint timestamp;
        uint160[] likes;
        mapping (uint160 => uint) likeIndex;
        uint[] comments;
        mapping (uint => uint) commentIndex;
        uint[] shares;
        mapping (uint => uint) shareIndex;
    }

    struct PostRepresentationMain {
        bytes text;
        bytes media_url;
        uint8 postType;
        uint160 author;
    }

    struct PostRepresentationSecondary {

        uint parentPost;
        uint timestamp;
        uint likes;
        uint comments;
        uint shares;
    }

    mapping (uint => Post) post;
    address authorized;
    uint public pageSize = 200;

    modifier postExists(uint postId) {
        require(_exists(postId), "You need to like an existing post");
        _;
    }

    modifier onlyAuthorized {
        require(_msgSender() == authorized, "Not authorized");
        _;
    }

    constructor() ERC721("Post", "POST"){ }

    function setPageSize(uint _pageSize) external onlyOwner {
        pageSize = _pageSize;
    }


    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override (ERC721Enumerable, ERC721){
        require(!paused(), "ERC721Pausable: token transfer while paused");
        super._beforeTokenTransfer(from, to, tokenId);
    }

    /**
     * @dev Returns weather a contracts supports a certain Interface.
     * @param interfaceId of the interface to check.
     * @return True if the contract supports such interface.
     */
    function supportsInterface(bytes4 interfaceId) public view virtual override (ERC721, ERC721Enumerable) returns (bool) {
        return interfaceId == type(IERC721).interfaceId || 
                interfaceId == type(IERC721Metadata).interfaceId || 
                super.supportsInterface(interfaceId);
    }

    function setAuthorized(address _authorized) external onlyOwner{
        authorized = _authorized;
    }

    function mint(bytes memory text, 
                  bytes memory media_url,
                  uint parentPost,
                  uint8 postType,
                  uint160 author
                  ) external 
                  onlyAuthorized returns (uint){

        require(address(author) == tx.origin, "You dont own this profile");

        //id must never be 0
        uint _id = totalSupply() + 1;

        //postType 0: normal post, 1: comment, 2: share
        if (postType > 0 ) {
            require(postType < 3, "Invalid post type");
            require(_exists(parentPost), "You need to provide a valid parent post");
            postType == 1 ? post[parentPost].comments.push(_id) : post[parentPost].shares.push(_id);
            }

        post[_id].text = text;
        post[_id].media_url = media_url;
        post[_id].postType = postType;
        post[_id].parentPost = parentPost;
        post[_id].timestamp = block.timestamp;
        post[_id].author = author;
        super._mint(address(author), _id);
        return _id;
    }

    function like(uint postId, uint160 author) external onlyAuthorized postExists(postId) {
        require(address(author) == tx.origin, "You dont own this profile");
        post[postId].likeIndex[author] = post[postId].likes.length;
        post[postId].likes.push(author);
    }

    function unlike(uint postId, uint160 author) external onlyAuthorized postExists(postId) {
        require(address(author) == tx.origin, "You dont own this profile");
        uint i = post[postId].likeIndex[author];
        uint total = post[postId].likes.length;

        if (i==0){
            require(post[postId].likes[i] == author, "You didnt like this post");
        }

        if (i != (total - 1)){
            post[postId].likeIndex[post[postId].likes[total - 1]] = i;
            post[postId].likes[i] = post[postId].likes[total - 1];
        }

        post[postId].likes.pop();
        delete post[postId].likeIndex[author];
    }

    function getPostMain(uint postId) external view returns(PostRepresentationMain memory){
        PostRepresentationMain memory response;

        response.text = post[postId].text;
        response.media_url = post[postId].media_url;
        response.author = post[postId].author;
        response.postType = post[postId].postType;

        return response;
    }

    function getPostSecondary(uint postId) external view returns(PostRepresentationSecondary memory){
        PostRepresentationSecondary memory response;

        response.parentPost = post[postId].parentPost;
        response.timestamp = post[postId].timestamp;
        response.likes = post[postId].likes.length;
        response.comments = post[postId].comments.length;
        response.shares = post[postId].shares.length;

        return response;
    }

    function getPostAuthor(uint postId) external view returns(uint160){
        return post[postId].author;
    }

    function getLikes(uint postId) external view returns (uint160[] memory){
        return post[postId].likes;
    }

    function getComments(uint postId) external view returns (uint[] memory){
        return post[postId].comments;
    }

    function getLikesPerPage(uint postId, uint8 page) external view returns (uint[] memory){

        uint total = post[postId].likes.length;

        uint[] memory response = new uint[](pageSize);
        uint i = pageSize*page;
        uint start = i;
        while(total > i && i < start + pageSize){
            response[i - start] = post[postId].likes[total - i -1];
            i+=1;
        }
        return response;
    }

    function getCommentsPerPage(uint postId, uint8 page) external view returns (uint[] memory){

        uint total = post[postId].comments.length;

        uint[] memory response = new uint[](pageSize);
        uint i = pageSize*page;
        uint start = i;
        while(total > i && i < start + pageSize){
            response[i - start] = post[postId].comments[total - i -1];
            i+=1;
        }
        return response;
    }
}
